-- Volcando estructura para procedimiento grupoarxpos.GetCortesCaja
DROP PROCEDURE IF EXISTS `GetCortesCaja`;
DELIMITER //
CREATE DEFINER=`grupoarxposuser`@`%` PROCEDURE `GetCortesCaja`()
BEGIN
		SELECT 
		   LEFT(rcpfec,10) as 'Fecha'
		 , rcpus1 as 'Usuario'
		 , rcpsub as 'Subtotal'
		 , rcpiva as 'IVA'
		 , rcptot as 'Total'
		 , rcppag as 'Forma de pago'
		  , rcpnum as 'NoComanda'
		  , rcppag as 'FormaPago'
		  ,case 
		    when (if(@prev_agent != rcpus1, @total := rcptot, @total := @total + rcptot)) is null 
		      then null
		    when (if(@prev_agent != rcpus1,  @corte := CONCAT('Corte ', LEFT(rcpfec,10)), @corte := @corte)) is null 
		      then null
		    when (@prev_agent := rcpus1) is null 
		      then null
		    else 
		      @total 
		    end as Total_acumulado
		  ,@corte as 'CorteCaja'
		  ,sum(rcptot) as 'Suma Total cortes'
		from rcp, (select @total:= 0.0, @prev_agent:=null, @corte:='Corte inicial') v 
		GROUP BY @corte
		order by rcpfec,rcpus1
		;

   END//
DELIMITER ;

-- Volcando estructura para procedimiento grupoarxpos.GetCortesCajaDetalle
DROP PROCEDURE IF EXISTS `GetCortesCajaDetalle`;
DELIMITER //
CREATE DEFINER=`grupoarxposuser`@`%` PROCEDURE `GetCortesCajaDetalle`()
BEGIN
SELECT
LEFT(rcpfec,10) as 'Fecha' -- 0
, rcpus1 as 'Usuario' -- 1
, rcpsub as 'Subtotal' -- 2
, rcpiva as 'IVA' -- 3
, rcptot as 'Total' -- 4
, rcppag as 'Forma de pago' -- 5
, rcpnum as 'NoComanda' -- 6
, rcppag as 'FormaPago' -- 7
,case
when (if(@prev_agent != rcpus1, @total := rcptot, @total := @total + rcptot)) is null
then null
when (if(@prev_agent != rcpus1, @corte := CONCAT('Corte ', LEFT(rcpfec,10)), @corte := @corte)) is null
then null
when (@prev_agent := rcpus1) is null
then null
else
@total
end as Total_acumulado -- 8
,@corte as 'CorteCaja' -- 9
,right(rcpfec,8) as 'Hora'
from rcp, (select @total:= 0.0, @prev_agent:=null, @corte:='Corte inicial') v
order by rcpfec,rcpus1
;

  END//
DELIMITER ;

